import React from 'react';
import twiter from '../images/twiter.jpg'
import me from '../images/me.jpg'

class Navbar extends React.Component {
	render() {
		return (
			<nav className=" bg-light container">
				<div className="container-fluid">

                    <div className="navbar-brand col-1">
                        <h6>HOME</h6>
                    </div>
                    <div className="navbar-brand col-2">
                        <h6>Notificacions</h6>
                    </div>
                    <div className="navbar-brand col-2">
                        <h6>Discover</h6>
                    </div>
                    <div className="navbar-brand col-3">
                        <p><img src={twiter} width="30" height="20"></img> <h6>Me</h6></p>
                    </div>
					<div className="navbar-brand col-1">
                       <img src={twiter} width="30" height="20"></img>
                    </div>
				</div>
			</nav>
		);
	}
}

export default Navbar;
